import React from 'react';
import { Navbar, Container } from 'react-bootstrap';

const Nav = () => {
  return (
      <Navbar bg="light" variant="light">
        <Container>
      <Navbar.Brand to="/">National Library</Navbar.Brand>
        <Nav className="me-auto">
          <Nav.Link to="/">Home</Nav.Link>
          <Nav.Link to="/MemberList">Members</Nav.Link>
          <Nav.Link to="/BookList">Books</Nav.Link>
        </Nav>
    </Container>
  </Navbar>

  );
};

export default Nav;
